import React from 'react';
import '../styles/Footer.css';

function Footer() {
  return (
    <footer className="footer">
      <p>Drug Compatibility Checker for Palliative Care</p>
      <p className="version">Version 1.0</p>
    </footer>
  );
}

export default Footer;
